package com.testwa.distest.server.mongo.model;import lombok.Data;import org.springframework.data.annotation.Id;import org.springframework.data.mongodb.core.index.Indexed;import org.springframework.data.mongodb.core.mapping.Document;/** * @Program: distest * @Description: 性能数据 * @Author: wen * @Create: 2018-05-23 10:21 **/@Data@Document(collection = "t_performance")public class Performance {    @Id    private String id;    @Indexed    private String deviceId;    @Indexed    private Long taskId;    private Long timestamp;    private Integer mem;    private Integer bat;    private Double cpu;    private Long wifiUp;    private Long wifiDown;    private Long gprsUp;    private Long gprsDown;    private Integer fps;}